// src/pages/checkout/CheckoutPage.jsx
import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import { createOrder } from '../../store/slices/ordersSlice';
import { clearCart, selectCartItems, selectCartGrandTotal } from '../../store/slices/cartSlice';
import { CheckoutForm } from './CheckoutForm';
import { CheckoutSummary } from './CheckoutSummary';

export function CheckoutPage() {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const cartItems = useSelector(selectCartItems);
  const totalAmount = useSelector(selectCartGrandTotal);
  const user = useSelector((state) => state.auth.user);
  const [isProcessing, setIsProcessing] = useState(false);
  const [error, setError] = useState(null);

  const handleSubmitOrder = async (formData) => {
    try {
      setIsProcessing(true);
      setError(null);

      // Перевірка наявності товарів
      if (!cartItems || cartItems.length === 0) {
        throw new Error('Your cart is empty');
      }

      // Підготовка даних для замовлення
      const orderData = {
        items: cartItems.map((item) => ({
          product: item._id, // ID товару
          quantity: item.quantity,
          price: item.price,
        })),
        shippingAddress: {
          fullName: formData.fullName,
          address: formData.address,
          city: formData.city,
          postalCode: formData.postalCode,
          country: formData.country || 'Ukraine', // Значення за замовчуванням
          phone: formData.phone,
        },
        paymentMethod: formData.paymentMethod,
        totalAmount: totalAmount,
        user: user._id, // ID користувача
      };

      console.log('Sending order data:', orderData); // Для відладки

      // Створення замовлення
      const result = await dispatch(createOrder(orderData)).unwrap();

      // Очищення кошика після успішного замовлення
      dispatch(clearCart());

      // Перенаправлення на сторінку успішного замовлення
      navigate('/orders/success', {
        state: { orderId: result._id },
      });
    } catch (err) {
      console.error('Failed to create order:', err);
      setError(err.message || 'Failed to create order');
    } finally {
      setIsProcessing(false);
    }
  };

  // Якщо користувач не авторизований
  if (!user) {
    return (
      <div className="min-h-screen bg-gray-100 py-8">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="bg-white rounded-lg shadow-md p-6 text-center">
            <h2 className="text-2xl font-bold text-gray-900 mb-4">Please login to continue</h2>
            <button
              onClick={() => navigate('/login', { state: { from: '/checkout' } })}
              className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700"
            >
              Login
            </button>
          </div>
        </div>
      </div>
    );
  }

  // Якщо кошик порожній
  if (!cartItems || cartItems.length === 0) {
    return (
      <div className="min-h-screen bg-gray-100 py-8">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="bg-white rounded-lg shadow-md p-6 text-center">
            <h2 className="text-2xl font-bold text-gray-900 mb-4">Your cart is empty</h2>
            <button
              onClick={() => navigate('/products')}
              className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700"
            >
              Continue Shopping
            </button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-100 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-8">Checkout</h1>

        {error && (
          <div className="mb-6 bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">
            {error}
          </div>
        )}

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          <div className="lg:col-span-2">
            <CheckoutForm
              onSubmit={handleSubmitOrder}
              isProcessing={isProcessing}
              initialData={{
                fullName: `${user.firstName} ${user.lastName}`,
                email: user.email,
                phone: user.phone || '',
                country: 'Ukraine', // Значення за замовчуванням
              }}
            />
          </div>
          <div className="lg:col-span-1">
            <CheckoutSummary items={cartItems} totalAmount={totalAmount} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default CheckoutPage;
